import { Injectable } from '@angular/core';
import { echodopplerTransc } from '../models/echodopplerTransc';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class EchodopplerService {

  private apiUrl = 'https://localhost:7129/api/EchodopplerTranscs';

  constructor(private http: HttpClient) { }
  addech(echodopplerTransc: echodopplerTransc): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', echodopplerTransc);

    return this.http.post<any>(`${this.apiUrl}/addech`, echodopplerTransc, { observe: 'response' });
  }}
